window.bookSummaryJSON = "<p>\"If all else perished, and he remained, I should still continue to be...I <i>am</i> Heathcliff....\" Catherine Earnshaw's passionate statement reveals the core of Emily Bronte's tempestuous literary masterpiece. Meeting as children, Catherine and Heathcliff begin a relationship that grows into obsession as family, class, and fate work against them as much as their own jealous natures.</p>"; 
